"""### Finetuning"""

from spacy.training.example import Example
import random

TRAIN_DATA = [
    ("The customer bought SKU-4321-XT from the shelf.", {
        "entities": [(21, 32, "PRODUCT_SKU")]
    }),
    ("Please check if SKU-9988-AB is in stock.", {
        "entities": [(18, 28, "PRODUCT_SKU")]
    }),
    ("We received an order for SKU-1122-ZZ today.", {
        "entities": [(26, 36, "PRODUCT_SKU")]
    }),
    ("Do you have SKU-2000-LM available?", {
        "entities": [(12, 22, "PRODUCT_SKU")]
    }),
    ("Customer asked for SKU-5555-WW again.", {
        "entities": [(21, 31, "PRODUCT_SKU")]
    }),
]

ner = NER.get_pipe("ner")

# Add the new label
ner.add_label("PRODUCT_SKU")

# Disable other pipes for efficient training
other_pipes = [pipe for pipe in NER.pipe_names if pipe != "ner"]

with NER.disable_pipes(*other_pipes):
    optimizer = NER.resume_training()
    for epoch in range(20):
        random.shuffle(TRAIN_DATA)
        losses = {}
        for text, annots in TRAIN_DATA:
            example = Example.from_dict(NER.make_doc(text), annots)
            NER.update([example], drop=0.3, losses=losses)
        print(f"Epoch {epoch + 1}, Loss: {losses['ner']:.3f}")

test_text = "They just added SKU-9988-AB to the store inventory."
doc = NER(test_text)
for ent in doc.ents:
    print(ent.text, ent.label_)

