ner_labels

def word2features(sent, i):
    word, postag, _ = sent[i]

    features = {
        'bias': 1.0,
        'word.lower()': word.lower(),
        'word[-3:]': word[-3:],
        'word[-2:]': word[-2:],
        'word.isupper()': word.isupper(),
        'word.istitle()': word.istitle(),
        'word.isdigit()': word.isdigit(),
        'postag': postag,
        'postag[:2]': postag[:2],
    }

    # Features for previous word (-1)
    if i > 0:
        word1, postag1, _ = sent[i - 1]
        features.update({
            '-1:word.lower()': word1.lower(),
            '-1:word.istitle()': word1.istitle(),
            '-1:word.isupper()': word1.isupper(),
            '-1:postag': postag1,
            '-1:postag[:2]': postag1[:2],
        })
    else:
        features['BOS'] = True  # Beginning of sentence


    # Features for next word (+1)
    if i < len(sent) - 1:
        word1, postag1, _ = sent[i + 1]
        features.update({
            '+1:word.lower()': word1.lower(),
            '+1:word.istitle()': word1.istitle(),
            '+1:word.isupper()': word1.isupper(),
            '+1:postag': postag1,
            '+1:postag[:2]': postag1[:2],
        })
    else:
        features['EOS'] = True  # End of sentence

    return features

def sent2features(sent):
    '''
    For each word in the sentence, it calls word2features() to extract features (like casing, prefixes, POS, neighbors, etc.)
    Returns a list of feature dictionaries, one per word
    '''
    return [word2features(sent, i) for i in range(len(sent))]

def sent2labels(sent):
    '''
    Extracts the NER labels from each word in the sentence
    Assumes the label is the 3rd item in each tuple
    Returns like ['B-PER', 'O', 'B-ORG'] for entire sentence
    '''
    return [label for _, _, label in sent]

def sent2tokens(sent):
    '''
    Extracts just the words/tokens from the sentence
    Assumes the token is the first item in each tuple
    Returns like ['Elon', 'works', 'at', 'Tesla']
    '''
    return [token for token, _, _ in sent]

ner_labels = dataset["train"].features["ner_tags"].feature.names
pos_labels = dataset["train"].features["pos_tags"].feature.names

def convert_to_crf_format(example):
    '''
    Convert an input example from numeric/tag-encoded format to readable format for training a CRF.
    '''
    tokens = example["tokens"]
    pos_ids = example["pos_tags"]
    ner_ids = example["ner_tags"]
    return [(word, pos_labels[pos], ner_labels[ner]) for word, pos, ner in zip(tokens, pos_ids, ner_ids)]

dataset['train'][0]

convert_to_crf_format(dataset['train'][0])

train_sents = [convert_to_crf_format(ex) for ex in dataset["train"]]
test_sents = [convert_to_crf_format(ex) for ex in dataset["test"]]

X_train = [sent2features(s) for s in train_sents]
y_train = [sent2labels(s) for s in train_sents]

X_test = [sent2features(s) for s in test_sents]
y_test = [sent2labels(s) for s in test_sents]

X_train

crf = sklearn_crfsuite.CRF(
    algorithm='lbfgs',
    max_iterations=100,
    c1=0.1,    # L1 regularization: sparsity
    c2=0.1,    # L2 regularization: smoothness
    all_possible_transitions=True
)
crf.fit(X_train, y_train)

y_pred = crf.predict(X_test)
print(metrics.flat_classification_report(y_test, y_pred))

y_pred

sample = [("Elon", "NNP", "O"), ("Musk", "NNP", "O"), ("visited", "VBD", "O"),
          ("Berlin", "NNP", "O"), (".", ".", "O")]

# Step 2: Extract features
X_sample = [sent2features(sample)]

# Step 3: Predict
y_sample_pred = crf.predict(X_sample)[0]

# Step 4: Display result
for (token, _, _), label in zip(sample, y_sample_pred):
    print(f"{token:10} → {label}")

